  INSERT INTO Customer (first_name, last_name, dob, email, contact_no, license_no)
  VALUES (p_first_name, p_last_name, p_dob, p_email, p_contact_no, p_license_no);

  SET p_new_cust_id = LAST_INSERT_ID();
END ;;
